INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.74, 1, 12300147, 5, 0, "vo_minigame_1012_result_1079", 1, 9, 3001, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 1, 7, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 1, 12300148, 5, 0, "vo_minigame_1012_result_1080", 1, 9, 3001, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 1, 1, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.21, 1, 12300149, 5, 0, "vo_minigame_1012_result_1081", 1, 9, 3001, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 2, 8, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.46, 1, 12300150, 5, 0, "vo_minigame_1012_result_1082", 1, 9, 3001, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 2, 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.94, 1, 12300151, 5, 0, "vo_minigame_1012_result_1083", 1, 9, 3001, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 2, 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.19, 1, 12300152, 5, 0, "vo_minigame_1012_result_1084", 1, 9, 3001, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 3, 7, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 1, 12300153, 5, 0, "vo_minigame_1012_result_1085", 1, 9, 3001, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 3, 1, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.63, 1, 12300154, 5, 0, "vo_minigame_1012_result_1086", 1, 9, 3001, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 3, 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.53, 1, 12300155, 1, 0, "vo_minigame_1012_result_1087", 1, 4, 3001, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1, 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 3, 12300156, 1, 9, "vo_minigame_1012_result_1088", 1, 4, 3001, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 1, 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.15, 1, 12300157, 1, 3, "vo_minigame_1012_result_1089", 1, 4, 3001, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 1, 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 9, 12300158, 1, 9, "vo_minigame_1012_result_1090", 1, 4, 3001, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 2, 9, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.37, 1, 12300159, 1, 0, "vo_minigame_1012_result_1091", 1, 4, 3001, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 2, 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (1.44, 1, 12300160, 1, 0, "vo_minigame_1012_result_1092", 1, 4, 3001, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 2, 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 3, 12300161, 1, 0, "vo_minigame_1012_result_1093", 1, 4, 3001, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 3, 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.91, 9, 12300162, 1, 3, "vo_minigame_1012_result_1094", 1, 4, 3001, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 3, 3, 2);
